import React, {Component} from 'react';

class Nav extends Component {
  render(){
    return(
      <nav>
        <ul>
          <li><a href="html.html">HTML</a></li>
          <li><a href="css.html">CSS</a></li>
          <li><a href="js.html">Javascript</a></li>
        </ul>
      </nav>
    )
  }
}

export default Nav;
